INSERT INTO `jobs` (`id`, `name`, `desc`, `ped`, `marker`, `scriptName`, `payment`, `level`, `upgrades`, `pedInfo`, `requirements`, `payment_points`, `payment_xp`, `skin`, `co-op`, `ownedVehicle`, `testState`, `weekDate`, `bonus`, `bonusTimeout`) VALUES
	(1, 'Magazynier', 'Praca polega na sortowaniu towarów na magazynie. Gdyby nie porządek na magazynie wszystkie dostawy trwałyby dłużej, a co za tym idzie brakłoby dostaw na wyznaczone terminy. Nie możesz do tego dopuścić, pracuj tak jakby to wszystko, zależało właśnie od Ciebie.', '16,1603.5427,1004.7621,10.8203,332.6894', '1605.0496,1006.2766,10.8203', 'px_jobs-warehouse', 69, 1, '[ [ { "icon": "running", "points": 200, "name": "Szybcior", "desc": "Zamiast się skradać, zacznij chodzić normalnie." }, { "icon": "biceps", "points": 500, "name": "Siłacz", "desc": "Zamiast małych paczek, zacznij nosić duże paczki." ,"money": 9}, { "icon": "forklift", "points": 850, "name": "Wózek widłowy", "desc": "Zacznij jeździć wózkiem widłowym.", "money": -13 } ] ]', 'Mirek, Kierownik', '', 1, 5, NULL, 0, '0', 0, '2025-02-04', 0, '0000-00-00'),
	(2, 'Rafineria', 'Praca polega na dowożeniu paliwa do stacji benzynowych znajdujących się w stanie San Andreas. Kiedy zdałeś prawo jazdy kategorii C, udaj się do pobliskiej rafinerii i zapytaj o możliwość pracy. Wiadomo, że ludzie muszą jakoś dojeżdżać z punktu A do punktu B, a większość z nich jeszcze potrzebuje do tego paliwa.', '127,262.2279,1435.5234,10.6359,177.4718', '262.0616,1432.3335,10.6359', 'px_jobs-refinery', 450, 1, '[ [ { "name": "Cysterna 7.500L", "points": 240, "icon": "fuel_tank_2", "desc": "Zacznij jeździć wiekszą cysterną!" ,"money":420, "offAll":true}, { "name": "Cysterna 10.000L", "points": 480, "icon": "fuel_tank_3", "desc": "Zacznij jeździć ogromną cysterną!" , "money":765,"offAll":true} ] ]', 'Władysław, Prezes', 'C', 1, 26, NULL, 0, '0', 0, '2025-02-04', 50, '2022-05-04'),
	(3, 'Śmieciarki', 'Praca polega na wywozie odpadów komunalnych. Kiedy zdałeś prawo jazdy kategorii C, udaj się na pobliskie wysypisko śmieci i zatrudnij się jako kierowca śmieciarki. Wywóz śmieci jest niezwykle potrzebny, gdyby nie śmieciarki nasza ekologia strasznie by podupadła. Możesz podjąć tę pracę wspólnie ze znajomymi.', '260,108.2073,1943.4946,18.3672,91.3560', '106.3813,1943.3665,18.3672', 'px_jobs-garbageTrucks', 1.2, 1, '[ [           { "icon": "running", "points": 100, "name": "Szybcior", "desc": "Zamiast się skradać, zacznij chodzić normalnie.", "money": -3 },           { "icon": "car_2", "points": 300, "name": "Śmieciarka 1T", "desc": "Jeździj lepszym pojazdem, z większym załadunkiem.", "money": 150,"offAll":true},          { "icon": "car_3", "points": 500, "name": "Śmieciarka 2T", "desc": "Jeździj lepszym pojazdem, z większym załadunkiem.", "money": 350,"offAll":true },      ] ]', 'Władysław, Kierownik', 'C', 2, 0.072, 260, 2, '0', 0, '2025-02-04', 50, '2022-05-04'),
	(4, 'Reklama samolotem', 'Reklama samolotem z powietrza. Po pozytywnie zdanej licencji pilota udajesz się na lotnisko, a tam otrzymasz swój przydzielony samolot. Praca polega na lataniu do wyznaczonych miejsc i otworzeniu banera w odpowiednim czasie, żeby zareklamować w konkretnym miejscu.', '61,1651.4342,1413.8314,10.4756,89.2653', '1649.8162,1413.7817,10.6', 'px_jobs-pilot-l1', 122, 1, '[ [ { "name": "Bak 50 litrów", "points": 850, "icon": "pilot_tank_1", "desc": "Powiększ swój bak i lataj dłużej!", "money": 12,"offAll":true }, { "name": "Bak 75 litrów", "points": 1000, "icon": "pilot_tank_2", "desc": "Powiększ swój bak i lataj dłużej!", "money": 24,"offAll":true } ] ] ', 'Szymon,\nPracownik lotniska', 'L1', 1, 8, NULL, 0, '0', 0, '2025-02-04', 0, '0000-00-00'),
	(5, 'Oprysk samolotem', 'Praca polega na opryskiwaniu pól rolniczych różnymi nawozami. Kiedy zdałeś pozytywnie licencję, która uprawnia Cię do pilotowania, udaj się na lotnisko, otrzymasz tam firmowy samolot typu cropduster. Twoim zdaniem jest opryskiwanie pól rolniczych różnymi nawozami.', '253,1651.5282,1419.0059,10.4754,93.0483', '1650.0031,1418.7631,10.6', 'px_jobs-pilot-l2', 134, 1, '[ [ { "name": "Jakościowy Oprysk + Bak 50L", "points": 310, "icon": "pilot_tank_1", "desc": "Lataj dłużej, zarabiając dodatkowe pieniądze", "money": 5,"offAll":true }, { "name": "Jakościowy Oprysk + Bak 75L", "points": 465, "icon": "pilot_tank_2", "desc": "Lataj dłużej, zarabiając dodatkowe pieniądze", "money": 10,"offAll":true }, ] ]', 'Jakub,\r\nPracownik lotniska', 'L2', 1, 9, NULL, 0, '0', 0, '2025-02-04', 0, '0000-00-00'),
	(6, 'Usuwanie pni', 'Załaduj ciągnik na lawetę i udaj się pod wskazane miejsce na mapie. Następnie za pomocą podłączonej do ciągnika frezarki usuń pień.', '16,-1066.7661,-1194.0938,129.6589,262.2083', '-1065.9231,-1194.0255,129.2188', 'px_jobs-tractors', 60, 1, '[ [                  { "icon": "tractors_1", "points": 800, "name": "Załadunek", "desc": "Automatyczny mechanizm załadunku." },                  { "icon": "tractors_2", "points": 1100, "name": "Większe pnie", "desc": "Zarabiaj więcej poprzez usuwanie większych pni.", "money":8 }    ] ]', 'Cezary, Kierownik', 'C', 1, 2, NULL, 0, '0', 0, '2025-02-04', 50, '2022-05-04'),
	(7, 'Kurier', 'Praca polega na dostarczaniu paczek do klientów indywidualnych/firm. Kiedy zdałeś prawo jazdy kategorii B, udaj się do firmy zajmującej się rozwożeniem paczek i zatrudnij się jako kurier. Twoim obowiązkiem będzie załadunek firmowego busa na magazynie, a następnie rozwiezienie paczek po wyznaczonym rejonie.', '17,2818.3706,979.7232,10.9141,65.1196', '2816.4414,980.5045,10.9141', 'px_jobs-courier', 122, 1, '[ [      { "icon": "running", "points": 185, "name": "Szybcior", "desc": "Zamiast się skradać, zacznij chodzić normalnie.", "money": 1},\n\n{ "icon": "biceps", "points": 400, "name": "Siłacz", "desc": "Zamiast małych paczek, zacznij wozić duże paczki." , "money": 6},\n\n{ "icon": "paczkomaty", "points": 740, "name": "Paczkomaty", "desc": "Zacznij rozwozić paczki po paczkomatach.", "money": 6},\n\n{ "icon": "car_2", "points": 980, "name": "Rumpo", "desc": "Jeździj lepszym pojazdem, z większym załadunkiem.", "money": -50,"offAll":true},\n\n{ "icon": "car_3", "points": 1400, "name": "Boxville", "desc": "Jeździj lepszym pojazdem, z większym załadunkiem.", "money": -11,"offAll":true},\n\n{ "icon": "car_4", "points": 1800, "name": "Speedo", "desc": "Jeździj lepszym pojazdem, z większym załadunkiem.", "money": -10,"offAll":true}, ] ]', 'Szymon, Pracodawca', 'B', 2, 8, 155, 0, '[ { "vehicles": [ 440, 413, 498, 582 ], \r\n"places": [ [2800.48291, 974.69580, 10, 3.306640625, 6.8812255859375, 2.03], [2804.9004,974.6468,10, 3.306640625, 6.8812255859375, 2.03], [2821.2334,974.6487,10, 3.306640625, 6.8812255859375, 2.03], [2826.0283,974.5867,10, 3.306640625, 6.8812255859375, 2.03] ], "object": [ 2817.5894,976.5541,11.7125,119.9085 ], "colshape": [ 2799.00952, 974.02081, 9.691879999999999, 31.39501953125, 39.701416015625, 7 ] } ]', 0, '2025-02-04', 50, '2022-05-04');
